import React from 'react';
import axios from 'axios';
import { useState } from 'react';
import { useEffect } from 'react';
import { useParams } from 'react-router-dom';

import classes from './'

const MobileData = () => {
  const [mobile, setMobile] = useState();
  const { id } = useParams();
  console.log(mobile);

  useEffect(() => {
    async function fetchMobile() {
      try {
        const { data } = await axios.get(
          `https://6363c19237f2167d6f828690.mockapi.io/items/` + id
        );
        setMobile(data);
      } catch (error) {
        alert('error');
      }
    }
    fetchMobile();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  if (!mobile) {
    return 'loading';
  }

  return (
    <div>
      <img className={classes.img} src={mobile.imageUrl} alt="" />
      <div>{mobile.title}</div>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Atque quaerat
        illo vitae laudantium mollitia pariatur voluptatibus commodi voluptas a
        quis, earum natus libero rem cumque voluptates. Modi dolorem odio quam.
      </p>
    </div>
  );
};

export default MobileData;
